V8:
“Zirvə Park” layihəsi Majestic Group-un Nərimanovda yerləşən Premium Layihəsidir. Əsas yoldan aralı və ekoloji cəhətdən təmiz ərazidə yerləşən kompleks Gənclik və Nərimanov metrostansiyaları, avtobus dayanacağı, məktəb, ticarət mərkəzi və digər obyektlərə yaxın ərazidə yerləşir.
Dövlət zəmanəti;
Hər mərtəbədə 4-6 mənzil;
Heydər Əliyev Mərkəzinə açılan panorama, dəniz mənzərəsi;
Hündür tavanlar;
Hər blokda 3 ədəd səssiz lift;
Qapalı həyət, 24 saat mühafizə və müşahidə kameraları;
Kart buraxılış sistemi;
Resepşn;
2 mərtəbəli yeraltı parkinq;
Yeraltı parkinqdən birbaşa liftə daxil olma imkanı;
Blok meydançalarının və pilləkənlərin mərmər ilə üzlənməsi;
Qəza generatorları;
Qazlaşdırma;
Mərkəzləşdirilmiş yanğın əleyhinə sistem;
Ehtiyat generatorlar sistemi;
Yüksəksürətli internet, kabel TV;
24 saat su təchizatı və su çəni;
Hər mənzildə eyvan;
Eyvanlarda traplar;
Uşaqlar üçün oyun attraksionları;
Mərkəzi elektrik təchizatı və generator;
Supermarket;
Eyvanlar ümumi mənzil sahəsinin az bir hissəsini təşkil edir və effektiv yerləşdirilmişdir;
Sanitar qovşaqlar və hamam otaqlarının ölçüləri ehtiyaca uyğun tənzimlənmişdir;
Qiymət – müqayisəli yanaşma zamanı analoji ərazidə və müvafiq keyfiyyət meyarlarına cavab verən mənzillərin satış qiymətləri ilə müqayisədə daha uyğun qiymətlərin təklif olunması.
